    return (
        <div>
            <header className="navbar">
                <nav>
                    <a className="navbar__title navbar__item">Cutco</a>
                    <a className="navbar__item">Contact</a>
                    <a className="navbar__item">Login</a>
                </nav>
            </header>
        </div>
    );
}

export default header;
